UPDATE region_geog set zaglebienie = 0 where id_parent is null;
UPDATE region_geog set zaglebienie = 1 where id_parent in (select id from region_geog where id_parent is null);
UPDATE region_geog set zaglebienie = 2 where id_parent in (select id from region_geog where id_parent in (select id from region_geog where id_parent is null));
UPDATE region_geog set zaglebienie = 3 where id_parent in (select id from region_geog where id_parent in (select id from region_geog where id_parent in (select id from region_geog where id_parent is null)));
UPDATE region_geog set zaglebienie = 4 where id_parent in (select id from region_geog where id_parent in (select id from region_geog where id_parent in (select id from region_geog where id_parent in (select id from region_geog where id_parent is null))));

